import React, { Component } from 'react'
import {SideBar, ContentDiv,GlobalStyle, Content} from './styles/SideBar'

export class App extends Component {
  render() {
    return (
      <React.Fragment>
        <GlobalStyle/>
        <SideBar>
          <ContentDiv>
            <Content>
              <h2>First todo stack</h2>
            </Content>
          </ContentDiv>
        </SideBar>
      </React.Fragment>
    )
  }
}

export default App
